import { useEffect } from 'react';

const Admin = ({ userRole }) => {
  const [error, setError] = useState("");

  useEffect(() => {
    if (userRole !== "admin") {
      setError("You are not authorized to view this page.");
      return;
    }   
  }, [userRole]);

  if (error) {
    return <div>{error}</div>;
  }

  return (
    <div>
      <button>Auth</button>
			<button>List</button>
    </div>
  );
};

export default Admin;
